血脂作用的洋葱、大豆、绿豆、花生、生姜、玉米、芹菜、海带、菠菜、枣等。每日胆固醇摄入量应控制在300mg以内，脂肪酸的摄入量不超过总热量30%。因饱和脂肪酸(S)能升高血浆胆固醇，故应控制在总热量的10%以内，而多不饱和脂肪酸(P)可降低胆固醇和甘油三酯，所以提倡进食P/S比值高而胆固醇含量少的食物。饮食勿过饱、过咸，甜食也应少吃。饮食治疗效果不理想的，多数仍须药物干预。\",\"appName\":\"pharmacogene\",\"followupTimes\":1,\"patientFollowupAttr\":{\"createdAt\":\"2016-12-06T16:12:26+08:00\",\"updatedAt\":\"2016-12-06T16:12:26+08:00\",\"id\":9,\"attribute\":\"treatmentScheme\",\"appName\":\"pharmacogene\",\"name\":\"治疗方案\",\"type\":\"text\"}},{\"createdAt\":\"2017-03-21T15:25:37+08:00\",\"updatedAt\":\"2017-03-21T15:25:37+08:00\",\"id\":21,\"patientId\":165,\"patientFollowupAttrId\":10,\"value\":[{\"drugName\":\"复方丹参片  \",\"dailyCount\":\"3\",\"measurement\":\"24\",\"unit\":\"g\"},{\"drugName\":\"通心络胶囊\",\"dailyCount\":\"3\",\"measurement\":\"18\",\"unit\":\"ml\"},{\"drugName\":\"银杏叶片 \",\"dailyCount\":\"3\",\"measurement\":\"15\",\"unit\":\"ml\"}],\"appName\":\"pharmacogene\",\"followupTimes\":1,\"patientFollowupAttr\":{\"createdAt\":\"2016-12-06T16:12:26+08:00\",\"updatedAt\":\"2016-12-06T16:12:26+08:00\",\"id\":10,\"attribute\":\"prescribe\",\"appName\":\"pharmacogene\",\"name\":\"治疗药物\",\"type\":\"array\"}},{\"createdAt\":\"2017-03-21T15:25:37+08:00\",\"updatedAt\":\"2017-03-21T15:25:37+08:00\",\"id\":22,\"patientId\":165,\"patientFollowupAttrId\":11,\"value\":\"已有显著改善，症状明显减轻。\",\"appName\":\"pharmacogene\",\"followupTimes\":1,\"patientFollowupAttr\":{\"createdAt\":\"2016-12-06T16:12:26+08:00\",\"updatedAt\":\"2016-12-06T16:12:26+08:00\",\"id\":11,\"attribute\":\"therapeuticEffect\",\"appName\":\"pharmacogene\",\"name\":\"治疗效果\",\"type\":\"string\"}}]','192.168.5.222','service','2017-03-21 15:25:37','2017-03-21 15:25:37'),(168,'27','caoxue01','曹雪','病例库-个人信息','修改病例成功','病例ID：164','修改病例成功','{\"mobile\":\"13615278901\",\"telephone\":null}','192.168.5.222','service','2017-03-21 15:26:21','2017-03-21 15:26:21'),(169,'28','fwt1','fwt','病例库-个人信息','修改病例成功','病例ID：162','修改病例成功','{\"maritalStatus\":\"已婚\",\"fertilitySituation\":{\"fertilityStatus\":\"其他\",\"n