INSERT INTO `patient_followup_values` VALUES (1,166,1,'pharmacogene','健在',1,'2017-03-21 15:06:28','2017-03-21 15:06:28'),(2,166,2,'pharmacogene','',1,'2017-03-21 15:06:28','2017-03-21 15:06:28'),(3,166,3,'pharmacogene','',1,'2017-03-21 15:06:28','2017-03-21 15:06:28'),(4,166,4,'pharmacogene','',1,'2017-03-21 15:06:28','2017-03-21 15:06:28'),(5,166,5,'pharmacogene','未失访',1,'2017-03-21 15:06:28','2017-03-21 15:06:28'),(6,166,6,'pharmacogene','',1,'2017-03-21 15:06:28','2017-03-21 15:06:28'),(7,166,7,'pharmacogene','正在治疗',1,'2017-03-21 15:06:28','2017-03-21 15:08:24'),(8,166,8,'pharmacogene','药物',1,'2017-03-21 15:06:28','2017-03-21 15:08:24'),(9,166,9,'pharmacogene','针对胃肠疾病的常见性、反复性，我们根据中医辨证施治的原理，结合现代生物提取技术，研究出最新胃肠疾病科研成果进行临床辨证治疗，开展了抗幽门螺杆菌系列中药疗法，治疗慢性胃炎、肠炎、胃癌等疾病。该疗法具有内外结合、标本同治、方法灵活、整体治疗的优点，突出显示中医中药治疗的特色优点，对急慢性胃炎、胃酸、胃胀、胃十二指肠溃疡、口干、口臭、恶心、呕吐、消化不良、腹胀、腹痛、腹泻等胃肠疾病的治疗结果有着显著的提高，可以完全修复胃粘膜，具有见效快，治愈率高，愈后不复发的优点，并根据临床不同类型的病情，针对性的确定个人治疗方案，一般患者1-3个疗程即可康复。',1,'2017-03-21 15:06:28','2017-03-21 15:08:24'),(10,166,10,'pharmacogene','[{\"drugName\":\"雷贝拉唑\",\"dailyCount\":\"1\",\"measurement\":\"10\",\"unit\":\"g\"},{\"drugName\":\"氢氧化铝凝胶\",\"dailyCount\":\"2\",\"measurement\":\"500\",\"unit\":\"ml\"},{\"drugName\":\"多酶片\",\"dailyCount\":\"3\",\"measurement\":\"10\",\"unit\":\"g\"}]',1,'2017-03-21 15:06:28','2017-03-21 15:12:25'),(11,166,11,'pharmacogene','症状无明显改善',1,'2017-03-21 15:06:28','2017-03-21 15:09:18'),(12,165,1,'pharmacogene','健在',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(13,165,2,'pharmacogene','',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(14,165,3,'pharmacogene','',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(15,165,4,'pharmacogene','',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(16,165,5,'pharmacogene','未失访',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(17,165,6,'pharmacogene','',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(18,165,7,'pharmacogene','正在治疗',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(19,165,8,'pharmacogene','药物',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(20,165,9,'pharmacogene','饮食治疗指导病人在去除病因，药物治疗的同时，改善饮食习惯。胆固醇控制在5.2mmol/L范围内，主要以饮食来调节。饮食以清淡为主，多吃新鲜蔬菜、瓜类和粗粮，少吃油腻及含脂高的食物，如动物油脂、内脏、肥肉、鱼子、蛋黄及高脂奶粉等，多吃有降血脂作用的洋葱、大豆、绿豆、花生、生姜、玉米、芹菜、海带、菠菜、枣等。每日胆固醇摄入量应控制在300mg以内，脂肪酸的摄入量不超过总热量30%。因饱和脂肪酸(S)能升高血浆胆固醇，故应控制在总热量的10%以内，而多不饱和脂肪酸(P)可降低胆固醇和甘油三酯，所以提倡进食P/S比值高而胆固醇含量少的食物。饮食勿过饱、过咸，甜食也应少吃。饮食治疗效果不理想的，多数仍须药物干预。',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(21,165,10,'pharmacogene','[{\"drugName\":\"复方丹参片  \",\"dailyCount\":\"3\",\"measurement\":\"24\",\"unit\":\"g\"},{\"drugName\":\"通心络胶囊\",\"dailyCount\":\"3\",\"measurement\":\"18\",\"unit\":\"ml\"},{\"drugName\":\"银杏叶片 \",\"dailyCount\":\"3\",\"measurement\":\"15\",\"unit\":\"ml\"}]',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(22,165,11,'pharmacogene','已有显著改善，症状明显减轻。',1,'2017-03-21 15:25:37','2017-03-21 15:25:37'),(23,167,1,'pharmacogene','健在',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(24,167,2,'pharmacogene','',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(25,167,3,'pharmacogene','',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(26,167,4,'pharmacogene','',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(27,167,5,'pharmacogene','未失访',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(28,167,6,'pharmacogene','',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(29,167,7,'pharmacogene','正在治疗',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(30,167,8,'pharmacogene','药物',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(31,167,9,'pharmacogene','针对胃肠疾病的常见性、反复性，我们根据中医辨证施治的原理，结合现代生物提取技术，研究出最新胃肠疾病科研成果进行临床辨证治疗，开展了抗幽门螺杆菌系列中药疗法，治疗慢性胃炎、肠炎、胃癌等疾病。该疗法具有内外结合、标本同治、方法灵活、整体治疗的优点，突出显示中医中药治疗的特色优点，对急慢性胃炎、胃酸、胃胀、胃十二指肠溃疡、口干、口臭、恶心、呕吐、消化不良、腹胀、腹痛、腹泻等胃肠疾病的治疗结果有着显著的提高，可以完全修复胃粘膜，具有见效快，治愈率高，愈后不复发的优点，并根据临床不同类型的病情，针对性的确定个人治疗方案，一般患者1-3个疗程即可康复。',1,'2017-03-23 16:25:27','2017-03-23 16:25:27'),(32,167,10,'pharmacogene','[{\"drugName\":\"氢氧化铝凝胶\",\"dailyCount\":\"2\",\"measurement\":\"500\",\"unit\":\"ml\"},{\"drugName\":\"多酶片\",\"dailyCount\":\"3\",\"measurement\":\"10\",\"unit\":\"g\"}]',1,'2017-03-23 16:25:2