DROP TABLE IF EXISTS `patients`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `patients` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `patient_no` varchar(255) DEFAULT NULL,
  `case_no` varchar(255) DEFAULT NULL,
  `identity_no` varchar(255) DEFAULT NULL,
  `clinical_diagnosis` json NOT NULL,
  `patient_name` varchar(255) NOT NULL,
  `gender` int(11) NOT NULL,
  `date_of_birth` date NOT NULL,
  `race` int(11) DEFAULT NULL,
  `ethnicity` varchar(255) DEFAULT NULL,
  `bloodType` varchar(255) DEFAULT NULL,
  `mobile` varchar(255) DEFAULT NULL,
  `telephone` varchar(255) DEFAULT NULL,
  `education` varchar(255) DEFAULT NULL,
  `occupation` varchar(255) DEFAULT NULL,
  `native_place` json DEFAULT NULL,
  `address` json DEFAULT NULL,
  `marital_status` varchar(255) DEFAULT NULL,
  `fertility_situation` json DEFAULT NULL,
  `annual_income` int(11) DEFAULT NULL,
  `payment_method` varchar(255) DEFAULT NULL,
  `is_deleted` tinyint(1) DEFAULT '0',
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `patient_no` (`patient_no`),
  UNIQUE KEY `case_no` (`case_no`),
  UNIQUE KEY `identity_no` (`identity_no`),
  UNIQUE KEY `patients_patientNo_unique` (`patient_no`),
  UNIQUE KEY `patients_caseNo_unique` (`case_no`),
  UNIQUE KEY `patients_identityNo_unique` (`identity_no`)
) ENGINE=InnoDB AUTO_INCREMENT=168 DEFAULT CHARSET=utf8;
